css:
body {
  font-size: 12px;
  color: #333;
  background-color: #FFFFFF;
}
atom-pane {
  border-right: 1px solid #2F343F;
}
atom-pane:last-child {
  border-right: none;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar {
  width: 10px;
  height: 10px;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-track {
  background: #2F343F;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-corner {
  background: #2F343F;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb {
  border-radius: 5px;
  border: 3px solid #2F343F;
  background: #D0D2D5;
  background-clip: content-box;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb:active,
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb:hover {
  border-width: 1px;
}
.scrollbars-visible-always atom-text-editor /deep/ ::-webkit-scrollbar-track,
.scrollbars-visible-always atom-pane-container /deep/ ::-webkit-scrollbar-track,
.scrollbars-visible-always atom-panel-container.bottom /deep/ ::-webkit-scrollbar-track {
  background: #fff;
}
.scrollbars-visible-always atom-text-editor /deep/ ::-webkit-scrollbar-corner,
.scrollbars-visible-always atom-pane-container /deep/ ::-webkit-scrollbar-corner,
.scrollbars-visible-always atom-panel-container.bottom /deep/ ::-webkit-scrollbar-corner {
  background: #fff;
}
.scrollbars-visible-always atom-text-editor /deep/ ::-webkit-scrollbar-thumb,
.scrollbars-visible-always atom-pane-container /deep/ ::-webkit-scrollbar-thumb,
.scrollbars-visible-always atom-panel-container.bottom /deep/ ::-webkit-scrollbar-thumb {
  border-color: #fff;
  background: #D0D2D5;
}
.btn {
  color: #a0a7bb;
  background-color: #454c5c;
}
.btn:hover,
.btn:focus {
  color: #333;
  background-color: #5f697f;
}
.btn:active {
  color: rgba(255, 255, 255, 0.66);
  background-color: #404756;
}
.btn.selected {
  color: #FFF;
  background-color: #5f697f;
}
.btn:focus,
.btn:focus:active {
  outline: none;
}
.btn.btn-primary {
  color: #FFF;
  background-color: #0088ff;
}
.btn.btn-primary:hover,
.btn.btn-primary:focus {
  background-color: #1492ff;
}
.btn.btn-primary:active {
  background-color: #007deb;
}
.btn.btn-primary.selected {
  background-color: #1492ff;
}
.btn.btn-primary.selected:focus,
.btn.btn-primary.selected:hover {
  background-color: #299bff;
}
.btn.btn-info {
  color: #FFF;
  background-color: #0088ff;
}
.btn.btn-info:hover,
.btn.btn-info:focus {
  background-color: #1492ff;
}
.btn.btn-info:active {
  background-color: #007deb;
}
.btn.btn-info.selected {
  background-color: #1492ff;
}
.btn.btn-info.selected:focus,
.btn.btn-info.selected:hover {
  background-color: #299bff;
}
.btn.btn-success {
  color: #FFF;
  background-color: #1c9c71;
}
.btn.btn-success:hover,
.btn.btn-success:focus {
  background-color: #1fad7e;
}
.btn.btn-success:active {
  background-color: #188b65;
}
.btn.btn-success.selected {
  background-color: #1fad7e;
}
.btn.btn-success.selected:focus,
.btn.btn-success.selected:hover {
  background-color: #22bf8a;
}
.btn.btn-warning {
  color: #FFF;
  background-color: #cc8533;
}
.btn.btn-warning:hover,
.btn.btn-warning:focus {
  background-color: #d08e43;
}
.btn.btn-warning:active {
  background-color: #bc7a2f;
}
.btn.btn-warning.selected {
  background-color: #d08e43;
}
.btn.btn-warning.selected:focus,
.btn.btn-warning.selected:hover {
  background-color: #d49854;
}
.btn.btn-error {
  color: #FFF;
  background-color: #d92626;
}
.btn.btn-error:hover,
.btn.btn-error:focus {
  background-color: #dc3838;
}
.btn.btn-error:active {
  background-color: #c72323;
}
.btn.btn-error.selected {
  background-color: #dc3838;
}
.btn.btn-error.selected:focus,
.btn.btn-error.selected:hover {
  background-color: #df4949;
}
.btn-group > .btn {
  border-color: rgba(0, 0, 0, 0.2);
}
atom-text-editor[mini] {
  padding-left: 5px;
  color: #333;
  border-radius: 0px;
  background-color: #fff;
}
atom-text-editor[mini].is-focused {
  background-color: #f2f2f2;
}
atom-text-editor[mini].editor .placeholder-text {
  color: #595959;
}
atom-text-editor[mini].editor .selection .region {
  background-color: #5294E2;
}
.find-and-replace {
  border-top: 1px solid #2F343F;
}
.find-and-replace .options-label,
.project-find .options-label {
  color: #8E97AE;
}
.find-and-replace .options-label .options,
.project-find .options-label .options {
  color: #bbc0ce;
}
.find-and-replace .description,
.project-find .description {
  color: #8E97AE;
}
.find-and-replace .description .subtle-info-message,
.project-find .description .subtle-info-message {
  color: #76819d;
}
.find-and-replace .description .subtle-info-message .highlight,
.project-find .description .subtle-info-message .highlight {
  color: #bbc0ce;
  background-color: #ffffff;
}
.status {
  color: #333;
}
.status-added {
  color: #73c990;
}
.status-ignored {
  color: #595959;
}
.status-modified {
  color: #e2c08d;
}
.status-removed {
  color: #ff6347;
}
.status-renamed {
  color: #6494ed;
}
.key-binding {
  display: inline-block;
  margin-left: 1px;
  padding: 0 5px;
  line-height: 2;
  font-family: 'Helvetica Neue', Arial, sans-serif;
  font-size: .8em;
  letter-spacing: 1px;
  border-radius: 0px;
  background-color: #FFFFFF;
}
.list-group li {
  padding-left: 5px;
}
.list-group li.selected {
  color: #FFF;
  background-color: #5294E2;
}
.list-group li.selected:before {
  display: none;
}
.list-tree .selected {
  color: #FFF;
}
.select-list li {
  padding: 5px 10px;
}
.select-list .status {
  float: right;
}
.select-list.popover-list {
  padding: 5px;
  border-radius: 0px;
  background-color: #2F343F;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.select-list.popover-list .list-group {
  margin-top: 5px;
}
.select-list.popover-list .list-group li {
  padding-left: 5px;
}
.overlay,
atom-panel.modal {
  box-shadow: 0 12px 36px 0 rgba(0, 0, 0, 0.4) !important;
  color: #8E97AE;
  border-radius: 0px;
  border: 0;
  padding: 0;
  width: 680px;
  margin-left: -340px;
  overflow: hidden;
}
@media (max-width: 768px) {
  .overlay,
  atom-panel.modal {
    width: 88%;
    left: 50%;
    margin-left: -44%;
  }
}
.overlay.from-top,
atom-panel.modal.from-top {
  top: 20%;
  border-top-right-radius: 0px;
  border-top-left-radius: 0px;
}
.overlay.from-top > *,
atom-panel.modal.from-top > * {
  padding: 0;
}
.overlay > * > *:not(.list-group),
atom-panel.modal > * > *:not(.list-group) {
  margin: 10px 20px;
}
.overlay .list-group,
atom-panel.modal .list-group,
.overlay .list-tree,
atom-panel.modal .list-tree {
  border-top: 1px solid #2F343F;
}
.overlay .list-group li.list-nested-item > .list-item,
atom-panel.modal .list-group li.list-nested-item > .list-item,
.overlay .list-tree li.list-nested-item > .list-item,
atom-panel.modal .list-tree li.list-nested-item > .list-item,
.overlay .list-group li:not(.list-nested-item),
atom-panel.modal .list-group li:not(.list-nested-item),
.overlay .list-tree li:not(.list-nested-item),
atom-panel.modal .list-tree li:not(.list-nested-item) {
  padding: 0.5em 20px;
}
.overlay .list-group li.list-nested-item > .list-item .character-match,
atom-panel.modal .list-group li.list-nested-item > .list-item .character-match,
.overlay .list-tree li.list-nested-item > .list-item .character-match,
atom-panel.modal .list-tree li.list-nested-item > .list-item .character-match,
.overlay .list-group li:not(.list-nested-item) .character-match,
atom-panel.modal .list-group li:not(.list-nested-item) .character-match,
.overlay .list-tree li:not(.list-nested-item) .character-match,
atom-panel.modal .list-tree li:not(.list-nested-item) .character-match {
  font-weight: normal;
}
.overlay .list-group li.selected,
atom-panel.modal .list-group li.selected,
.overlay .list-tree li.selected,
atom-panel.modal .list-tree li.selected {
  background: #5294E2;
}
.overlay .list-group li:not(.selected) .character-match,
atom-panel.modal .list-group li:not(.selected) .character-match,
.overlay .list-tree li:not(.selected) .character-match,
atom-panel.modal .list-tree li:not(.selected) .character-match {
  color: #bbc0ce;
}
.overlay .list-group li:not(.selected):hover,
atom-panel.modal .list-group li:not(.selected):hover,
.overlay .list-tree li:not(.selected):hover,
atom-panel.modal .list-tree li:not(.selected):hover {
  color: #bbc0ce;
  background: transparent;
}
.overlay .list-group li .key-binding,
atom-panel.modal .list-group li .key-binding,
.overlay .list-tree li .key-binding,
atom-panel.modal .list-tree li .key-binding {
  background: #fff;
  border-radius: 2px;
}
.overlay atom-text-editor.mini,
atom-panel.modal atom-text-editor.mini,
.overlay atom-text-editor.mini.editor,
atom-panel.modal atom-text-editor.mini.editor {
  max-height: none;
  background-color: transparent;
  color: #8E97AE;
  border: 0;
  border-radius: 0;
  padding: 0;
}
.overlay atom-text-editor.mini .text,
atom-panel.modal atom-text-editor.mini .text,
.overlay atom-text-editor.mini.editor .text,
atom-panel.modal atom-text-editor.mini.editor .text {
  font-size: 2rem;
  height: 1.3em;
  line-height: 1.3em;
}
.overlay /deep/ ::-webkit-scrollbar-track,
atom-panel.modal /deep/ ::-webkit-scrollbar-track {
  background: #2F343F;
  border-bottom-right-radius: 8px;
}
.overlay /deep/ ::-webkit-scrollbar-corner,
atom-panel.modal /deep/ ::-webkit-scrollbar-corner {
  background: #2F343F;
}
.overlay /deep/ ::-webkit-scrollbar-thumb,
atom-panel.modal /deep/ ::-webkit-scrollbar-thumb {
  border-color: #2F343F;
  background: #D0D2D5;
}
.select-list.popover-list,
.autocomplete-suggestion-list.select-list.popover-list {
  background-color: #2F343F;
  color: #8E97AE;
  border-radius: 0px;
  border: 0;
}
.select-list.popover-list .suggestion-description,
.autocomplete-suggestion-list.select-list.popover-list .suggestion-description {
  background: #2F343F;
}
.select-list.popover-list atom-text-editor,
.autocomplete-suggestion-list.select-list.popover-list atom-text-editor {
  margin-bottom: 5px;
}
.select-list.popover-list .list-group li,
.autocomplete-suggestion-list.select-list.popover-list .list-group li {
  padding-left: 5px;
  color: #8E97AE;
}
.select-list.popover-list .list-group li .character-match,
.autocomplete-suggestion-list.select-list.popover-list .list-group li .character-match {
  color: #bbc0ce;
}
.select-list.popover-list /deep/ ::-webkit-scrollbar-track,
.autocomplete-suggestion-list.select-list.popover-list /deep/ ::-webkit-scrollbar-track {
  background: #2F343F;
}
.select-list.popover-list /deep/ ::-webkit-scrollbar-corner,
.autocomplete-suggestion-list.select-list.popover-list /deep/ ::-webkit-scrollbar-corner {
  background: #2F343F;
}
.select-list.popover-list /deep/ ::-webkit-scrollbar-thumb,
.autocomplete-suggestion-list.select-list.popover-list /deep/ ::-webkit-scrollbar-thumb {
  border-color: #2F343F;
  background: #D0D2D5;
}
.panel-heading {
  background-color: #2F343F;
  color: #8E97AE;
}
.panel-body {
  background-color: #fff;
}
.inset-panel {
  background-color: #2F343F;
}
.inset-panel .panel-heading {
  background-color: #383e4b;
}
atom-panel.bottom.tool-panel {
  color: #8E97AE;
  background-color: #fff;
}
atom-panel.modal {
  border: 1px solid #2F343F;
  border-top: none;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.loading-spinner-large {
  display: block;
  width: 64px;
  height: 64px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px 64px;
}
.loading-spinner-large.inline-block {
  display: inline-block;
}
.loading-spinner-medium {
  display: block;
  width: 48px;
  height: 48px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 48px 48px;
}
.loading-spinner-medium.inline-block {
  display: inline-block;
}
.loading-spinner-small {
  display: block;
  width: 32px;
  height: 32px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 32px 32px;
}
.loading-spinner-small.inline-block {
  display: inline-block;
}
.loading-spinner-tiny {
  display: block;
  width: 16px;
  height: 16px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 16px 16px;
}
.loading-spinner-tiny.inline-block {
  display: inline-block;
}
.settings-view .config-menu {
  background: transparent;
  border-color: #ebebeb;
}
.settings-view select.form-control {
  border-color: #f7f7f7;
  background-color: #f7f7f7;
}
.settings-view select.form-control:hover,
.settings-view select.form-control:focus {
  background-color: #e6e6e6;
}
.settings-view .package-card {
  background-color: #f7f7f7;
  border-color: #f7f7f7;
  border-radius: 2px;
}
.settings-view .package-card:hover,
.settings-view .package-card.disabled {
  background-color: #e6e6e6;
}
.settings-view .btn {
  color: #424242;
  background-color: #ffffff;
}
.settings-view .btn:hover,
.settings-view .btn:focus {
  color: #333;
  background-color: #fafafa;
}
.settings-view .btn:active {
  color: rgba(255, 255, 255, 0.66);
  background-color: #404756;
}
.settings-view .btn.selected {
  color: #FFF;
  background-color: #5f697f;
}
.settings-view .btn:focus,
.settings-view .btn:focus:active {
  outline: none;
}
.settings-view .section {
  border-color: #ebebeb;
}
.ui-site-1 {
  background-color: #0088ff;
}
.ui-site-2 {
  background-color: #20b684;
}
.ui-site-3 {
  background-color: #cc8533;
}
.ui-site-4 {
  background-color: #D831B0;
}
.ui-site-5 {
  background-color: #EBDD5B;
}
.status-bar {
  font-size: 12px;
  color: #8E97AE;
  border-top: 1px solid #2F343F;
  background-color: #2F343F;
}
.status-bar a {
  color: #8E97AE;
}
.status-bar a:hover {
  color: #bbc0ce;
}
.status-bar .cursor-position a {
  color: #8E97AE;
}
.status-bar .cursor-position a:hover {
  color: #bbc0ce;
}
.status-bar linter-bottom-tab {
  color: #8E97AE;
}
.status-bar linter-bottom-tab.active {
  color: #bbc0ce;
}
.tab-bar {
  background-color: #2F343F;
  border-bottom: 3px solid #fff;
  padding-top: 3px;
}
.tab-bar .tab {
  color: #8E97AE;
  height: 30px;
  line-height: 30px;
  font-size: 12px;
  border-right: 1px solid #2F343F;
  background-color: #2F343F;
  border-top-left-radius: 1px;
  border-top-right-radius: 1px;
}
.tab-bar .tab.active {
  color: #333;
  background-color: #fff;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  top: 50%;
  right: 14px;
  margin-top: -3px;
  border-color: #6494ed;
}
.tab-bar .tab.modified:hover .close-icon {
  color: currentColor;
}
.tab-bar .tab .close-icon:hover {
  color: #FFF;
}
.tab-bar .tab.active .close-icon:hover {
  color: #333;
}
.tab-bar .tab.is-dragging {
  background: #191c22;
  border-color: transparent;
  opacity: .5;
}
.tab-bar .tab.is-dragging .close-icon {
  visibility: hidden;
}
.text-smaller {
  font-size: smaller;
}
.text-subtle {
  color: #595959;
}
.text-highlight {
  color: #333;
}
.text-info {
  color: #6494ed;
}
.text-success {
  color: #73c990;
}
.text-warning {
  color: #e2c08d;
}
.text-error {
  color: #ff6347;
}
.highlight {
  padding: 1px 4px;
  color: #333;
  border-radius: 0px;
  background-color: #fff;
}
.highlight-info {
  padding: 1px 4px;
  color: #333;
  border-radius: 0px;
  background-color: #0088ff;
}
.highlight-warning {
  padding: 1px 4px;
  color: #333;
  border-radius: 0px;
  background-color: #cc8533;
}
.highlight-error {
  padding: 1px 4px;
  color: #333;
  border-radius: 0px;
  background-color: #d92626;
}
.highlight-success {
  padding: 1px 4px;
  color: #333;
  border-radius: 0px;
  background-color: #1c9c71;
}
.background-message {
  font-weight: bold;
  color: #595959;
}
.tooltip .tooltip-inner {
  line-height: 1;
  padding: .75em;
  white-space: nowrap;
  max-width: none;
}
.tooltip .keystroke {
  padding: .15em .4em;
  margin: 0 -0.3em 0 0.25em;
  border-radius: 2px;
  color: #FFF;
  background: #5294E2;
}
atom-overlay {
  color: #8E97AE;
}
.tree-view-resizer {
  border-right: 1px solid #2F343F;
}
.tree-view {
  color: #8E97AE;
  background-color: #2F343F;
  padding-top: 6px;
  /*.list-item.selected {
    color: @text-color-selected;
  }*/
}
.tree-view .list-item,
.tree-view .list-nested-item {
